import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [cartes, setCards] = useState([]);
  useEffect(() => {
    const getCards = async () => {
      try {
        const { data } = axios.get('https://api.pokemontcg.io/v1/cards?pageSize=10');
        setCards(data.cards);
      } catch (err) {
        console.error(err)
      }
    };
    getCards();
    console.log(cartes)
  }, []);
  return (
    <div>
      <h1>Pokemon Cards rarity</h1>
    </div>
  );
}

export default App;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
